INSERT INTO `tbberita` VALUES ('1', 'Perancangan dan Pembuatan Sistem Informasi Akademik Sekolah Berbasis WAP (Studi kasus SMAN 1 Jatirogo Kab. Tuban)', 'Dunia pendidikan saat ini semakin maju, di kawasan perkotaan dengan kemajuan teknologi saat ini segala informasi mengenai pendidikan bisa di dapat secara mudah dan cepat, permasalahan yang terjadi adalah orang tua kurang bisa mengontrol kegiatan anaknya selama di sekolah, sedangkan pihak sekolah tidak mungkin bisa mengawasi kegiatan semua siswanya secara penuh. SMA Negeri 1 Jatirogo Kab Tuban sampai saat ini penyebaran informasi mengenai segala sesuatu yang berhubungan dengan kegiatan akademik masih dilakukan secara manual sehingga menimbulkan berbagai permasalahan diantaranya kecepatan, ketepatan dan keakuratan. Untuk mengatasi hal tersebut dibuatlah suatu Sistem Informasi Akademik dengan berbasis WAP. Sistem Informasi Akademik yang dirancang dapat diakses oleh siswa dan orang tua agar bisa memonitor kegiatan siswa selama disekolah, informasi yang akan disampaikan melalui WAP meliputi : Absensi, nilai, data embayaran, informasi beasiswa dan lain-lain. Pembuatan aplikasi WAP dengan WML dan data base My SQL.');
INSERT INTO `tbberita` VALUES ('2', 'IMPLEMENTASI ALGORITMA HALF BYTE UNTUK PEMAMPATAN KARAKTER DALAM LAYANAN SMS (SHORT MESSAGE SERVICE) ', 'Dalam dunia komputer dan internet, pemampatan file digunakan dalam berbagai keperluan. Jika anda ingin mem-backup data, anda tidak perlu menyalin semua file aslinya, dengan memampatkan (mengecilkan ukurannya) file tersebut terlebih dahulu maka kapasitas tempat penyimpanan yang diperlukan akan menjadi lebih kecil. Jika sewaktu-waktu data tersebut anda perlukan, baru dikembalikan lagi ke file aslinya. SMS merupakan cara pengiriman pesan singkat dalam waktu cepat dengan harga relatif murah. Pesan singkat ini akan dikirimkan dengan kapasitas maksimal 140 byte setiap pesannya atau 160 karakter.Untuk mengatasi kesulitan penyampaian pesan dengan  jumlah karakter banyak ataupun karakter dengan bit besar, dikembangkan suatu aplikasi untuk melakukan kompresi teks dengan menggunakan Algoritma Half Byte.Dalam penelitian tugas akhir ini akan dibuat aplikasi penghemat pesan SMS atau SMS Compression. Metode kompresi yang digunakan adalah Algoritma Half Byte. Aplikasi ini merupakan serangkaian proses yang berupa pemampatan SMS, dekompresi SMS, pengiriman SMS, serta penerimaan SMS. Proses pemampatan SMS itu sendiri merupakan suatu proses  encoding yang akan menjadikan suatu data memiliki bit yang lebih kecil dari biasanya. Dengan menggunakan  aplikasi ini, kita berharap bisa sedikit berhemat. Karena jika untuk 1 SMS maksimal hanya menggunakan 160 karakter dengan aplikasi ini  memungkinkan kita untuk mengetik lebih dari 160 karakter hingga 240 karakter. ');
INSERT INTO `tbberita` VALUES ('3', 'Rancang Bangun Aplikasi Game Multiplayer Battleship Dengan Jaringan Lokal ', 'Game Battleship pada pada umumnya hanya dimainkan 2 (dua) player saja. Terbatasnya jumlah pemain dalam permainan  Game Battleship yang membuat permainan terlihat  monoton dan membosankan. Untuk mendapatkan tanatangan baru dalam permainan Game Battleship. Maka pada Tugas Akhir ini, diberi penambahan jumlah pemain, dari sebelumnya hanya 2 (dua) player menjadi 4 (empat) player yang akan menambah seru dan tantangan jika memainkan Game Battleship. Bahkan tiap  player  akan memakai teknik dan strategi \r\npermainan yang baru. Game Battleship memiliki sedikit perbedaan dengan game sejenis yang ada sekarang di internet,  karena terdiri dari 4 (empat)  player. Terutama aturan permainannya, jika mendapat giliran menembak, maka harus memilih 1 (satu) di antara 3 (tiga) musuhnya. Begitu juga ketika berhasil menembah kapal musuh, maka tidak akan mendapat giliran  1 (satu) kali seperti pada umumnya  game Battleship.  Namun, cara permainannya tetap sama, yaitu menekan kotak  yang diyakini letak kapal musuh. Pemenengnya ditentukan oleh yang berhasil mempertahankan armada kapalnya. Game Multiplayer Battleship memerlukan peran teknologi jaringan untuk peng-implementasi-an. Permainan ini bisa digunakan pada komputer yang terkoneksi pada LAN (Local Area Network), akan tetapi bisa juga diaminakan pada localhost. Semua bisa dilakukan karena menggunakan komponen  Windows Socket (Winsock) sebagai sarana koneksi pada MS-Windows pada protocol TCP/IP. ');
INSERT INTO `tbberita` VALUES ('4', 'APLIKASI MULTIMEDIA PEMBELAJARAN FIQIH SHOLAT BERBASIS WEB ', 'Banyak perbedaan pendapat tentang tata cara sholat yang ada di masyarakat. Sulit  dijumpai buku tentang tata cara sholat yang memuat secara  detail dasar dalil tiap gerakan sholat  serta perbedaan yang ada tersebut. Kebanyakan dari buku tersebut hanya memuat nama gerakan, bacaan  atau terkadang juga dilengkapi dengan gambar gerakannya.Solusi dari  permasalahan tersebut  adalah dengan  membuat aplikasi multimedia  pembelajaran  fiqih  sholat  berbasis web yang  mudah dipahami, interaktif  dan dinamis (menggabungkan media teks arab, teks \r\nlatin,  gambar,  video  dan suara, serta  soal  ujian  yang bisa diupdate), dengan melakukan penelitian terhadap tiga kitab sekaligus sebagai sumber dan pembanding untuk bahan materi pembelajarannya. Hasilnya diperoleh suatu aplikasi multimedia pembelajaran  fiqih  sholat berbasis web yang memberikan media  pembelajaran berupa video, suara, serta dasar dalil dan perbedaan-perbedaan yang ada secara detail. ');
INSERT INTO `tbberita` VALUES ('5', 'STEGANOGRAFI AUDIO BERFORMAT WAV UNTUK PENGIRIMAN RAHASIA MENGGUNAKAN METODE SPREAD SPECTRUM ', 'Masalah keamanan dan kerahasiaan data merupakan hal yang sangat penting dalam suatu organisasi atau pribadi. Salah satu hal yang penting dalam komunikasi menggunakan komputer untuk menjamin kerahasiaan data adalah dengan menggunakan perangkat-perangkat pengaman seperti steganografi ataupun \r\nkriptografi. Steganografi merupakan ilmu dan seni yang mempelajari cara penyembunyian pesan rahasia ke dalam suatu media sedemikian sehingga pihak ketiga tidak menyadari keberadaan pesan tersebut. Pada Proposal Tugas Akhir ini membahas studi mengenai bagaimana steganografi pada media audio digital. Spread spectrum adalah sebuah metode steganografi yang diilhami dari skema komunikasi spread spectrum, yang mentransmisikan sebuah sinyal sempit menjadi sebuah kanal pita lebar, kegunaan dari penyebaran ini adalah untuk menambah bit-bit pesan sehingga menjadi pesan dengan bit-bit yang panjang tergantung dengan spreadernya.');
INSERT INTO `tbberita` VALUES ('6', 'IMPLEMENTASI PENJADWALAN MATA KULIAH MENGGUNAKAN ALGORITMA GENETIKA DI JURUSAN TEKNIK INFORMATIKA UNIVERSITAS TRUNOJOYO ', 'Penjadwalan mata kuliah di Jurusan Teknik Informatika Universitas Trunojoyo di lakukan setiap pergantian  semester.Permasalahan pembuatan jadwal mata kuliah merupakan permasalahan yang sangat kompleks. Beberapa faktor yang mendukung penjadwalan mata kuliah antara lain  dosen, mata kuliah serta jumlah ruang dan waktu yang tersedia. Salah satu metode yang dapat digunakan untuk menyelesaikan permasalahan tersebut adalah dengan menggunakan pendekatan algoritma genetika. Algoritma genetika merupakan pendekatan komputasional untuk menyelesaikan masalah yang dimodelkan dengan proses biologi dari evolusi. Hasil pengujian yang dilakukan dengan 300 generasi dimana setiap generasinya terdiri dari 10 individu atau kromosom, pada hasil generasi algoritma genetika mampu memberikan solusi penjadwalan dengan nilai fitness  1 atau dengan persentase keberhasilan 100%. ');
INSERT INTO `tbberita` VALUES ('7', 'RANCANG BANGUN SISTEM INFORMASI GEOGRAFIS SEBAGAI PENDUKUNG KEPUTUSAN  PEMERATAAN TENAGA KESEHATAN PUSKESMAS DI  KABUPATEN GRESIK ', 'Puskesmas merupakan sarana pelayanan kesehatan strata pertama dalam pelaksanaan pembangunan kesehatan. Untuk mencapai hasil optimal dan meningkatkan mutu serta  kinerja Puskesmas, perlu adanya tenaga kesehatan yang sesuai dengan kebutuhan. Untuk memberikan kemudahan Pemerintah daerah dalam memonitoring dan mengetahui jumlah tenaga kesehatan yang ada di puskesmas, maka perlu adanya Sisten Informasi Geografis yang sesuai dengan kebutuhan dan prosedur penyusunan rencana kebutuhan sumber daya manusia kesehatan. Study kasus yang dipilih adalah di daerah kabupaten Gresik dimana data yang diperoleh berasal dari Dinas Kesehatan dengan mengambil objek semua puskesmas yang ada di kabupaten Gresik. Sistem ini berupa desktop yang memberikan inputan \r\nkebutuhan data untuk perhitungan produktivitas puskesmas. Sedangkan untuk outputannya adalah hasil dari penghitungan kebutuhan sumber daya manusia kesehatan dengan menggunakan metode Daftar Susunan Pegawai (DSP). Metode ini sesuai dengan pedoman penyusunan perencanaan sumber daya manusia kesehatan Mentri Kesehatan Republik Indonesia tahun 2004. Dengan adanya aplikasi ini Dinas Kesehatan dapat mengetahui jumlah kebutuhan tenaga kesehatan di tiap puskesmas berdasarkan daya guna staff yang ada pada tiap puskesmas. Sedangkan untuk letak tiap puskesmas dapat ditunjukkan di dalam peta sehingga dapat secara detail mengetahui jumlah puskesmas dan jumlah tenaga kesehatannya. ');
INSERT INTO `tbberita` VALUES ('8', 'RANCANG BANGUN APLIKASI MULTIMEDIA PEMBELAJARAN INTERAKTIF UNTUK MANASIK HAJI BERBASIS WEB', 'Menunaikan ibadah haji adalah sesuatu yang amat dirindukan oleh setiap umat Islam, bahkan oleh yang telah menunaikannya berkali-kali sekalipun. Karena itu, bagi yang dimudahkan Allah untuk bisa menunaikan ibadah haji tahun ini agar menggunakan kesempatan emas itu dengan sebaik-baiknya. Sebab, belum tentu kesempatan menunaikan ibadah haji itu datang kembali. Perjalanan ibadah haji adalah perjalanan suci yang memerlukan kesiapan fisik dan mental serta pengetahuan tentang manasik haji dan proses pelaksanaan ibadahnya. Media pembelajaran interaktif mengenai tata cara pelaksanaan manasik haji akan sangat mendukung niat seseorang untuk melaksanakan ibadah haji ini, karena media ini menjadi alat bantu ajar bagi para calon jemaah haji supaya dapat melaksanakan ibadah haji ini dengan benar ketika nantinya mereka benar-benar berada di tanah suci. Media ini juga akan memberikan pengetahuan bagi semua umat muslim tentang tata cara manasik haji yang benar dalam waktu yang relatif singkat. Sehingga setelah mempelajari media ini mereka nantinya akan memiliki keinginan juga untuk menunaikan ibadah haji. Dalam tugas akhir ini dibuat sebuah aplikasi multimedia pembelajaran interaktif yang di dalamnya memuat tentang tata cara manasik haji. Aplikasi ini dikembangkan dengan menggunakan PHP sebagai web programming dan My SQL sebagai database server.');
INSERT INTO `tbberita` VALUES ('9', 'RANCANG BANGUN APLIKASI PORTABLE  UNTUK PELAKSANAAN EVALUASI BELAJAR SISWA BERBASIS JARINGAN CLIENT SERVER ', 'Evaluasi merupakan salah satu faktor penting untuk efektivitas pembelajaran, baik terhadap proses maupun hasil pembelajaran.  Agar tercapai proses dan hasil pembelajaran yang optimal maka dikembangkan  sebuah media pembelajaran dengan menggunakan aplikasi  portable  yang dijalankan pada media penyimpanan  flashdisk \r\ndan jaringan client server. Suatu  sistem  aplikasi  portable  yang telah  terhubung  dengan jaringan  client server  memudahkan guru dan siswa dalam melakukan proses evaluasi. Guru akan  mengirimkan data-data soal yang di request oleh  siswa,  dan siswa akan  mengirim jawaban soal yang telah dikerjakan. Nilai siswa dapat langsung diketahui hasilnya setelah jawaban soal dikirimkan kepada guru. Aplikasi  portable  ini dapat  berjalan  menggunakan media flashdisk pada jaringan client server. Kecepatan kinerja aplikasi portable pada jaringan  dipengaruhi  oleh  daya  tampung penyimpanan  flashdisk yang semakin besar, RAM,  processor  pada komputer  server,  dan banyaknya request  dari web client  secara bersamaan. ');
INSERT INTO `tbberita` VALUES ('10', 'Perancangan dan Pembuatan Sistem Pendukung Keputusan Pengukuran dan Analisis Produktivitas Usaha Kecil dan Menengah Menggunakan Metode Objective Matrix (Studi Kasus : Dinas Perindustrian dan Perdagangan Kabupaten Bangkalan)', 'Produktivitas merupakan salah satu faktor penting dalam kesejahteraan Usaha Kecil dan Menengah (UKM). Dinas Perindustrian dan Perdagangan (Disperindag) sebagai  fasilisator pembinaan UKM, setiap tahun melakukan kegiatan pengukuran dan analisis terhadap UKM di Kabupaten Bangkalan. Namun sistem yang digunakan saat ini masih manual, yaitu observasi langsung oleh tim survey pada tiap lokasi se-Kabupten Bangkalan, dan penetapan keputusan oleh pimpinan Disperindag yang masih bersifat subyektif. Oleh karena itu pada penelitian tugas akhir ini dibuat Sistem Pendukung Keputusan yang dapat mengidentifikasi kriteria pembinaan yang lebih efektif dan analisis keputusan yang lebih akurat.  Yaitu dengan membuat sistem pengukuran berupa  pertanyaan secara online menggunakan Skala Diferensial Semantik, dimana  tiap-tiap pertanyaan mewakili indikator-indikator pengukuran.  Selanjutnya akan diproses dengan menggunakan metode Objective Matrix untuk mendapatkan skor kinerja dan rekomendasi kriteria pembinaan dari kriteria sedang dan buruk. Untuk sistem analisisnya yaitu dengan  mengetahui peramalan nilai produksi tahun mendatang menggunakan metode  Autokorelasi. Apabila  UKM termasuk produktif (peramalan nilai produksi menunjjukkan peningkatan terhadap tahun sebelumnya), maka rekomendasi hasil pengukuran UKM akan diterima. Hasil penelitian  menujjukkan bahwa UKM komoditi meubel termasuk salah satu produk unggulan kabupaten Bangkalan. Hal ini karena 7 dari 10 UKM meubel adalah UKM produktif. Oleh karena itu sangat baik apabila UKM-UKM tersebut dibina, agar nilai produksinya lebih maksimal.  ');
INSERT INTO `tbberita` VALUES ('11', 'PERANCANGAN DAN IMPLEMENTASI SISTEM INFORMASI PERSONALIA ( STUDI KASUS PT MADURA GUANO INDUSTRI )', 'PT Madura Guano Industri adalah suatu perusahaan yang bergerak dalam bidang export dan import yang penjualannya hingga keluar negeri. Dalam hal ini tentunya karyawan sangat mempengaruhi proses produksi. Selain hal tersebut, pemgumpulan data masih  bersifat manual, sehingga sering terjadi human error. Dari  Penelitian  tersebut penulis    merancang  dan mengimplementasi   Sistem Informasi Personalia yang dapat membantu sistem kerja divisi supaya lebih higienis dan dapat mempersingkat waktu dan tenaga.  Selain hal tersebut, peneliti juga merancang suatu sistem pengambil keputusan perekrutan karyawan menggunakan metode pembobotan Resiprokal Ranking dan sistem pengambil keputusan karyawan berprestasi menggunakan metode pembobotan Resiprokal Ranking dan Metode Scooring. Dengan adanya suatu perancangan tersebut, diharapkan dapat memperlancar proses kerja karyawan khususnya staff personalia dan menghasilkan karyawan yang bermutu dan bermanfaat bagi  perusahaan. ');
INSERT INTO `tbberita` VALUES ('12', 'APLIKASI GAME MOBILE SAKERA MAZE MENGGUNAKAN METODE FINITE STATE MACHINE(FSM) BERBASIS J2ME', 'Handphone merupakan alat komunikasi yang mudah digunakan. Selain mudah, informasi dapat diakses dengan cepat, dari mana saja dan kapan saja. Dengan berkembangnya kebutuhan manusia akan teknologi,Handphone tidak hanya sebagai alat komunikasi saja. Banyak aplikasi- aplikasi didalamnya, contohnya aplikasi game. Maze Games merupakan game yang didalamnya terdapat unsur logika, memiliki suatu teknik dan pemikiran serta manajemen didalamnya.Sehingga para pengguna merasa tertantang dalam memainkan game tersebut. FSM(Finite State  Machine) merupakan salah satu metode penerapan AI di game yang populer diterapkan untuk pengambilan keputusan yang cerdas. Penerapan FSM yang banyak ditemui adalah untuk membentuk NPC (Non Player Character) yang cerdas. Dalam proyek akhir ini akan dibuat aplikasi maze game yang dijalankan pada handphone dengan menggunakan bahasa pemrograman J2ME (Java 2 Micro Edition)Game  ini merupakan game maze yang menggunakan tokoh pahlawan madura yaitu Sakera dari Pulau madura.');
INSERT INTO `tbberita` VALUES ('13', 'APLIKASI GAME BALAPAN KUDA BERBASIS PERSONAL COMPUTER ', 'Olahraga balapan kuda termasuk olahraga mahal dan sulit dimainkan. Tidak semua lapisan masyarakat dapat memainkan olahraga ini.Sedangkan permainan komputer (game) adalah hiburan dalam kehidupan  sehari-hari. Banyak permainan (game) yang dibuat agar para pengguna tertarik dalam memainkannya. Game flash merupakan salah satu jenis Game yang cukup digemari sebagai hiburan. Selain menawarkan banyak sekali varian, Game flash juga cukup ringan sehingga dengan komputer “tua” pun masih  dapat memainkan Game flash dengan lancar. Rule set merupakan kumpulan rule yang saling terkait.Rule \r\nmerupakan struktur IF/THEN yang secara logika menghubungkan informasi yang tersimpan dalam bagian  IF yang juga dikenal sebagai premis, dengan informasi yang tersimpan dalam bagian THEN.Untuk itu dibuat aplikasi Game balapan kuda yang bertujuan untuk menerapkan olahraga balapan kuda di game. Selain itu Game balapan kuda ini bertujuan untuk menghibur masyarakat dan menambah variasi Game pada personal computer (PC).Aplikasi Game balapan ini dibuat menggunakan flash dan Artificial  Intelligence (AI) yang digunakan adalah rule set. ');
INSERT INTO `tbberita` VALUES ('14', 'Rancang Bangun Sistem Pendukung Keputusan Penentuan Pemberian Bantuan Pengembangan Usaha Agribisnis Pedesaan (PUAP) Menggunakan Metode SMARTER (Studi Kasus Dinas Pertanian & Peternakan Kab Bangkalan)', 'Para petani di Daerah Bangkalan yang tergabung dalam wadah Gabungan Kelompok Tani (Gapoktan) akan menerima bantuan modal untuk Pengembangan Usaha Agribisnis Pedesaan (PUAP) yang merupakan program Departemen Pertanian RI sebagai upaya Pemerintah Pusat menanggulangi kemiskinan dan menciptakan lapangan kerja di perdesaan.Dalam penentuan pemberian bantuan ini membutuhkan sebuah sistem yang dapat mempermudah Dinas Pertanian dan Pertenakan di Kabupaten Bangkalan dalam menentukan siapa saja yang layak mendapat bantuan PUAP tersebut.Sistem ini nantinya akan mempermudah pekerjaan Dinas Pertanian dan Pertenakan Kabupaten Bangkalan siapa saja yang berhak mendapat bantuan. Digunakan \r\nmetode SMARTER untuk menentukan bobot dari setiap kriteria dalam suatu pengambilan keputusan.Dalam pembuatan SPK ini data– data diperoleh dari data yang tersimpan dalam subsistem basis data maupun  variable lain yang diinputkan oleh user. Sedangkan outputnya merupakan suatu informasi berupa penentuan penerimaan bantuan Pengembangan Usaha Agribisnis Pedesaan. ');
INSERT INTO `tbberita` VALUES ('15', 'PERANCANGAN DAN PEMBUATAN SISTEM PENDUKUNG KEPUTUSAN PEMENANG TENDER PROYEK MENGGUNAKAN METODE ACCORD (Studi kasus Unit Layanan Pengadaan Kab.Bangkalan)', 'Dalam pelelangan barang /jasa dari tahap–tahap pelaksanaan pengadaan barang /jasa konvensional ini banyak merugikan seperti,Jika para penyedia barang /jasa (peserta) banyak,maka akan menimbulkan antrian yang cukup berkepanjangan.Proses yang di lakukan sangat memakan waktu sehingga waktu terbuang sia-sia.Penyedia barang /jasa (peserta lelang) akan merasakan kejenuhan dan kelelahan dan adanya persekongkolan tender di mana pelaku usaha melakukan kerjasama dengan pelaku usaha lain untuk menguasai pasar dengan cara mengatur dan menentukan pemenang tender sehingga dapat mengakibatkan persaingan usaha yang tidak sehat.Dengan adanya kelemahan proses Pengadaan barang /jasa tersebut  maka di buat suatu perangkat lunak Sistem Pendukung Keputusan yang berfungsi membantu dan memudahkan tim pengambil keputusan untuk menentukan pemenang tender proyek yang efektif dan efisien. Proses pengambilan keputusan menggunakan Metode Accord yang dilakukan bersama oleh tim pengambil keputusan dengan mengevaluasi alternatif berdasarkan kriteria-kriteria pengambilan keputusan yang ada. Sehingga telah dapat menentukan keputusan alternatif terbaik sebagai pemenang tender proyek.Perangkatlunak ini diimplementasikan dengan menggunakan aplikasi berbasis web dengan bahasa pemrograman PHP dan MySQL sebagai databasenya. ');
INSERT INTO `tbberita` VALUES ('16', 'PERANCANGAN APLIKASI GAME ULAR TANGGA DENGAN MENGGUNAKAN CRYSTAL SPACE GAME ENGINE ', 'Game ular tangga salah satu jenis game yang cukup dikenal di masyarakat umum, namun sudah jarang dimainkan karena sekarang anak – anak lebih tertarik pada game elektronik yang memiliki tampilan lebih menarik.Oleh sebab itu dibuat sebuah aplikasi game ular tangga yang berbentuk 3D menggunakan crystal space game engine. Crytal space merupakan salah satu game engine yang open source. Crystal space memiliki kerangka lebih umum sehingga dapat digunakan untuk setiap jenis visualisasi 3D,game engine ini sangat portable dan berjalan pada Microsoft windows, GNU/Linux dan Mac OS X');
INSERT INTO `tbberita` VALUES ('17', 'SISTEM PENDUKUNG KEPUTUSAN PENGANGKATAN JABATAN PEGAWAI NEGERI SIPIL MENGGUNAKAN METODE ACCORD', 'Kedudukan dan peranan Pegawai Negeri dalam setiap organisasi Pemerintahan mempunyai peranan yang sangat penting, sebab Pegawai Negeri merupakan tulang punggung Pemerintah dalam melaksanakan Pembangunan Nasional.Di dalam pelaksanaan dan penyelenggaraannya yang bermacam-macam dan banyak segi yang mengalami kesulitan-kesulitan sehingga memerlukan proses pemilihan pegawai yang sebaik-baiknya,termasuk dalam proses pengangkatan calon pegawai untuk menduduki suatu jabatan.Metode yang digunakan dalam tugas akhir pengambilan keputusan menentukan pengangkatan calon pegawai adalah metode Accord.Dalam metode perhitungannya melibatkan faktor knowledge (tingkat pengetahuan) dan juga faktor confidence (tingkat keyakinan) penguji terhadap peserta, serta dapat diketahui tingkat kepuasan terhadap hasil \r\nakhir.');
INSERT INTO `tbberita` VALUES ('18', 'RANCANG BANGUN PERANGKAT LUNAK SISTEM PAKAR KONSULTASI KEHAMILAN DENGAN METODE NAÏVE BAYES CLASSIFIER ', 'Pada saat ini Angka Kematian Ibu (AKI) di Indonesia masih sangat tinggi. Petugas kesehatan seyogyanya dapat mengidentifikasi faktor-faktor risiko penyebab kematian ibu hamil yang berhubungan dengan usia, paritas, riwayat kehamilan yang buruk, dan perdarahan selama kehamilan. Sistem yang akan dibangun ini merupakan sistem pakar yang digunakan dalam proses pemeriksaan kehamilan. Sistem ini akan berperan seperti seorang pakar, dalam hal ini bidan sebagai tenaga kesehatan yang melakukan analisa atas data-data pasiennya yaitu ibu hamil untuk menentukan penyuluhan/konseling serta mengidentifikasi resiko kehamilan untuk merencanakan tempat dan penolong persalinan. Sistem ini juga dapat mendokumentasikan hasil pemeriksaan dan data awal pasien untuk dijadikan bahan analisa pada kunjungan pasien berikutnya. Dalam perancangan basis pengetahuan digunakan penalaran berbasis aturan (Rule-Based Reasoning), sedangkan untuk penarikan kesimpulan digunakan metode klasifikasi yaitu Naive Bayes (NB) Classifier. Dengan adanya sistem pakar konsultasi kehamilan ini diharapkan dapat membantu meringankan tugas tenaga kesehatan,memudahkan pasien dalam memperoleh informasi mengenai keadaan dirinya dan hal-hal yang harus dilakukan berhubungan dengan itu sekaligus meningkatkan mutu pelayanan pemeriksaan kehamilan');
INSERT INTO `tbberita` VALUES ('19', 'SISTEM PERAMALAN KEBUTUHAN OBAT PADA RUANG RAWAT INAP DENGAN MENGGUNAKAN METODE JST BACKPROPAGATION STUDI KASUS DI RUMAH SAKIT DR.M SOEWANDHIE SURABAYA', 'Rumah Sakit Umum Daerah Dr M.Soewandhie adalah salah satu rumah sakit yang dimiliki oleh pemerintah Surabaya.Sebagai rumah sakit milik pemerintah Surabaya, rumah sakit ini memiliki peranan dalam memberikan bantuan pelayanan kesehatan kepada masyarakat daerah Surabaya dan sekitarnya. Rumah sakit ini \r\nmemiliki bagian apotik yang mempunyai tugas dalam pengadaan kebutuhan obat-obatan, infus dalam rumah sakit Kendala yang sering dialami pengelola rumah sakit ini adalah kurang dapat mengontrol dan mengawasi persediaan kebutuhan obat. Hal ini menyebabkan pengadaan obat kurang efisien karena stok berlebihan atau kekurangan stok obat.Penerapan Metode Jaringan Saraf Tiruan Backpropagation dalam Sistem Peramalan Kebutuhan Obat Pada Rawat Inap untuk mengatasi beberapa permasalahan yaitu stok berlebihan, kehabisan \r\nstok pada rawat inap sehingga dapat membantu pengelola dalam pengadaan obat agar lebih efisien. Dari hasil uji coba, dapat disimpulkan bahwa keakuratan sistem dipengaruhi oleh pelatihan JST Backpropagation. Jadi apabila data dilatih maka MAPE yang dihasilkan lebih kecil daripada yang belum dilatih. Setelah dilakukan uji coba sistem dengan menghitung MSE, RMSE, dan MAPE, didapat hasil terbaik yaitu pada Learning rate 0.008, momentum 0.02, eppoch max 1000 atau error toleransi 0.001. Tingkat keakurasian yang diperoleh sekitar 98%. ');
INSERT INTO `tbberita` VALUES ('23', 'coba', 'Sistem Informasi Akademik dengan berbasis WAP. Sistem Informasi Akademik yang dirancang dapat diakses oleh siswa dan orang tua agar bisa memonitor kegiatan siswa selama disekolah, informasi yang akan disampaikan melalui WAP meliputi : Absensi, nilai, data embayaran, informasi beasiswa dan lain-lain. Pembuatan aplikasi WAP dengan WML dan data base My SQL.');
INSERT INTO `tbberita` VALUES ('20', 'PENGGUNAAN JARINGAN SARAF TIRUAN DALAM PENGENALAN POLA ANGKA DENGAN METODE LEARNING VECTOR QUANTIZATION (LVQ)', 'Pemanfaatan teknologi Jaringan Syaraf Tiruan (JST) sudah banyak dilakukan pada berbagai bidang, dan salah satu bidang yang mulai memanfaatkan teknologi ini adalah pattern recognition (pengenalan pola).Pada penelitian Tugas Akhir ini dibuat sebuah sistem pengenalan angka dengan memanfaatkan konsep JST. Metode JST yang digunakan adalah Learning Vector Quantization (LVQ). Jaringan syaraf tiruan LVQ terdiri atas lapisan input, lapisan tersembunyi, dan lapisan output.Dalam system pengenalan pola angka ini ada beberapa tahap\r\nyang dilakukan, antara lain Grayscale, Monokrom, Cropping,Normalisasi, dan ekstraksi fiture FLDA. Kemudian dilakukan pelatihan serta pengenalan dengan metode LVQ. Pembuatan perangkat lunak ini menggunakan bahasa pemro graman Borland Delphi 7. Angka-angka yang dikenali adalah angka -angka ketik yang disimpan dalam file\r\ngambar bertipe (*BMP).Data pelatihan yang digunakan sebanyak 50 angka dan data uji coba sebanyak 200 angka.\r\nDengan menggunakan ekstraksi feature Fisher Linear Discriminant Analysis (FLDA) dan Learning Vector Quatization (LVQ)sebagai classifier, serta untuk learning rate 0,05 dengan epoh maximal 100 dan error minimum yang diharapkan (eps) 0.000001 menperoleh tingkat akurasi keberhasilan sebesar 70,95  %.');
